import React from "react";
import CategoryItem from "./CategoryItem";

const CategoryList = () => {
  return (
    <>
      <div className="App text-center">
        <h1>Category</h1>

        <div className="d-flex p-3 justify-content-center ">
          <CategoryItem />
          <CategoryItem />
          <CategoryItem />
        </div>
      </div>
    </>
  );
};

export default CategoryList;
